syntax="proto3";
package cn.easii.tutelary.message;
option java_outer_classname = "CommandExecuteResponse$$ByJProtobuf";
//
message CommandExecuteResponse {  
 string taskId=1;
 int32 code=2;
 int64 timestamp=3;
 Any data=4;
 bool status=5;
 string message=6;
 Metadata metadata=7;
}
//
message Metadata {  
 string token=1;
}
message Any {  
 string codecClass=1;
 bytes byteArray=2;
}
